@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("debianforum.ru") {
img[src*="/topic/"],img[src*="/icons/quick_lock"],img[src*="/icons/quick_sticky"] {
  height:18px;
  padding-left:18px;
  width:0;
  vertical-align: middle!important;
  background-repeat: no-repeat;
  margin: 2px 0;
  background-image: url(data:image/png;base64,)!important;
}
img[src*="normal_post"] {background-position: 0 0; }
img[src*="hot_post"] {background-position: -18px 0; }
